import React from 'react';
import {CustomNavbar} from './CustomDrawers';
import Box from '@mui/material/Box';
import AppBar from '@mui/material/Box';
// import {useNavigate} from "react-router-dom";

/**
 * Home Component
 * @return {object} JSX
 */
function Home() {
  // const navigate = useNavigate();
  return (
      <Box>
        <AppBar />
        <CustomNavbar />
        <Box name= 'content' sx={{display: 'flex', alignItems: 'center',
          flexDirection: 'column'}}>
          <Box sx={{minWidth: 900, width: '90%', height: 500}}
          backgroundColor = 'tertiary.main'>
          </Box>
          <Box sx={{minWidth: 900, width: '90%', height: 100}}
          backgroundColor = 'primary.main'>
          </Box>
        </Box>
      </Box>
  );
}

export default Home;
